import React from 'react';
import ReactDOM from 'react-dom';
import { createRoot } from 'react-dom/client';
import App from './App';
import './index.css';

const root = document.getElementById('root') || document.createElement('div');

createRoot(root).render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

document.addEventListener('DOMContentLoaded', function () {
  const interactiveZones = document.querySelectorAll('.interactiveZone');

  interactiveZones.forEach(zone => {
      zone.addEventListener('click', function () {
          const videoPath = this.getAttribute('data-video');

          if (videoPath) {
              // Lancez votre logique pour afficher ou jouer la vidéo ici
              console.log('Clic sur la zone, démarrer la vidéo :', videoPath);
          }
      });
  });
});
